  // const trackURI = 'spotify:track:2qb5ASYergjk2qNLvYEQJD';
  const [imageData, setimageData] = useState("");
  const  handleImageData = (data) =>{setimageData(data)};
  return (
    <div className="App">
      <WebcamCapture  onTakePhoto={handleImageData}/>
      {/* <SpotifyEmbed trackURI={trackURI}/> */}
      {imageData.length() && <Pred imageData={imageData} />}

    </div>
  );
}

export default App;
